import React from "react";

export default function Product(props) {
  const { item } = props;
  return (
    <div>
      <img src={item.images} alt={item.item_name}></img>
      <h4>{item.item_name}</h4>
      <div>${item.price}</div>
      <div>
        <button>add to cart</button>
      </div>
    </div>
  );
}
